import React from 'react';

const Rank = ({name, entery}) => {
     return(
         <div>
     <div className='tc white f3'>
         <p>`{name}Your current rank is.....`</p>
         </div>
         <div className=" white f1">
             {entery} !!!
         </div>
         </div>
     );
}

export default Rank;
